INSERT INTO `ykb_company_info` VALUES ('1', '易考帮', '11111111111', '222222222222', 'asasdasd', '/zhiyiapi/Uploads/2019-05-30/5cef74922173a.png', '/zhiyiapi/Uploads/2019-05-30/5cef7497521bb.png', '111111111asd', 'sdasdasd', '/zhiyiapi/Uploads/2019-05-27/5ceb7f8bc9fb3.png', '126.627808', '45.726806', '1559196824', 'bc0f305e-6bf5-464c-8657-2e483cf4d863', '111');
INSERT INTO `ykb_company_intro` VALUES ('12', '介绍1', '易考帮团队由数十名拥有多年艺考经验的老师和艺术类专业的高校毕业生组成。旨在为艺考考生提供服务。现阶段主要服务对象为美术、书法、传媒、舞蹈、音乐专业的考生', '', '1', 'E753BE4A21A7', 'bc0f305e-6bf5-464c-8657-2e483cf4d863');
INSERT INTO `ykb_company_intro` VALUES ('13', '关键介绍2，放在关于我们和文章介绍', '黑龙江易考帮教育咨询有限公司，以文化产业交流策划、大数据分析、高考志愿咨询、艺术服务为一体，经过多年探索与实践，易考帮服务团队已发展成为东北地区权威的教育服务平台', '', '2', '36F3B385DC04', 'bc0f305e-6bf5-464c-8657-2e483cf4d863');
INSERT INTO `ykb_company_intro` VALUES ('14', '学业规划', '艺考这一年，面对联考、校考、文化课，这三座大山，很多学生都不知道具体如何规划，如何平衡好专业和文化之间的矛盾。鉴于此，黑龙江易考帮团队特聘请拥有多年为艺考生服务经验的专家老师为考生合理规划时间。黑龙江易考帮团队始终坚持“录取才是王道”，从前期的学业规划——中期的校考指导——后期的志愿填报，一步步为艺术生量身制定一套完整的升学方案。艺考过程中的每一个关键环节我们都严格地为学生把关，切实地解决艺考过程中遇到的每一个问题。', '', '3', '2948BDFDC1B1', 'bc0f305e-6bf5-464c-8657-2e483cf4d863');
INSERT INTO `ykb_company_intro` VALUES ('15', '校考服务', '进入校考阶段，易考帮团队综合往年各高等院校（含十大美院、艺术类院校及重点综合类大学）校考及录取信息，为每一位艺考生针对性推荐院校（包含冲击类、能力类、保守类三个层次）。同时还会组织教授、名师、优秀在读生及毕业生讲解各专业区别与就业方向，确保同学们理性、科学地报考院校。冲击名校稳中求胜。同时易考帮团队与国内多所旅行社、酒店建立长期稳定合作，拥有专属的带队考试车队、专业的带队指导老师，让你的校考舒适、放心，能够以最佳的状态参加考试。', '', '4', '833B70137686', 'bc0f305e-6bf5-464c-8657-2e483cf4d863');
INSERT INTO `ykb_company_intro` VALUES ('16', '志愿指导', '在追梦的道路上，艺术生会比普通学生走得更加艰难。要结合专业联考、校考、高考三个分数选择院校。有这样一句话形容高考志愿填报的重要性“考的好，不如报的好”过线不算什么，录取才是王道。让艺术生考上好大学才是我们的最终目的。而每年因为志愿填报失误落榜的考生不胜枚举，为了让艺术生避免这些悲剧的发生，易考帮每年都会举行面向全省艺术生的志愿公益指导讲座，线上社群分享，线下一对一专家指导，帮助校内外的学生和家长正确科学的填报，确保被更好的学校录取。', '', '5', '964BBA328C10', 'bc0f305e-6bf5-464c-8657-2e483cf4d863');
INSERT INTO `ykb_company_ys` VALUES ('7', '为什么选择我们', '通过大数据整理精确考生走向，针对分省计划校考招生院校，对考生的竞争对手进行跟踪分析，明确考生志愿填报及录取方向。', '', '0', 'bc0f305e-6bf5-464c-8657-2e483cf4d863', '29495D51DC8A');
INSERT INTO `ykb_company_ys` VALUES ('8', '如何院校匹配', '结合考生联考分和高考分匹配近三年分数相近的院校，在基础上考生也可进一步根据自身情况进行分析筛选。', '', '0', 'bc0f305e-6bf5-464c-8657-2e483cf4d863', '39B4E9CBFE13');
INSERT INTO `ykb_company_ys` VALUES ('9', '我们有何优势', '结合当年及往年考生分数走向大数据分析，对考生自身优势进行分析解读，使考生对自己情况更加清晰明确。', '', '0', 'bc0f305e-6bf5-464c-8657-2e483cf4d863', 'DD56B01165C3');
